Full-stack AI Agent Engineer (LangChain) at DoubleO.ai
APPLY NOW
Full-stack AI Agent Engineer (LangChain) at DoubleO.ai
Location: Remote (Preference for India; open to South America & Europe time zones, flexible working hours)
Type: Full-time
DoubleO exists to give non-technical people the superpowers of elite AI engineers. Born from years of experience building award-winning AI tools for product teams, we’ve developed a powerful platform that allows anyone to build intelligent automations — no coding required.
Founded by leaders from Meta, Rippling, and PlayStation, and backed by top Silicon Valley investors, we’re an engineering-led company pushing the boundaries of what AI can do in real business workflows.
We’re looking for a Full Stack AI Engineer to join our tightly-knit AI team. You’ll build internal tools and customer-facing AI agents end-to-end — from back-end logic to UI, from prompt design to LangChain flows.
You’ll be part of a team where everyone is an AI engineer. We don’t silo frontend/backend or infra/data. Instead, we move fast, write 50% of our code with AI tools, and ship useful agents that save users real hours every day.
What You’ll Do
Build full-stack AI applications using Python, LangChain, and LangGraph;
Work on both internal workflows and external, user-facing agent tools;
Develop and deploy RAG systems and LLM-powered agents;
Own features end-to-end — from problem scoping and prompt design to database modeling and UI;
Collaborate with a small, senior team to prototype quickly and ship constantly;
Leverage AI tools to move faster and write better code.
Who You Are
5–6 years of total software engineering experience, including full-stack development;
Hands-on with AI tools: comfortable building with LLMs, LangChain, and RAG;
Hands-on experience. You still write and ship code daily. You’re curious, fast, and obsessed with learning;
Strong Python skills, with bonus points for exposure to React or similar front-end tools;
Have 2-3 years of LangChain experience;
Familiar with building intelligent workflows or automations, not just CRUD apps;
Bonus: experience with cloud infra, vector DBs, or fine-tuning LLMs.
What we offer
Full-time job. Please note that we won’t consider candidates planning to combine this job with another one.
Remote work. You may be located in almost any country, just need a good Internet connection, a computer to work from, and the opportunity to adjust your working schedule for the team.
Work with some of the brightest minds in AI from companies like Meta and Rippling.
Join an early team with a massive impact on product and culture.
Build things that people use immediately, not in quarters.
Salary will be discussed during the interview. Paid in USD.
Application deadline: ASAP.
Please note that the later you apply - the more intensive your selection process will be, for example, you will have less time for the test assignment, etc.
Fill in the application form - attach your CV and Github profile;
Have a Zoom interview with Hire5 Recruiter;
Complete a practical test assignment;
Have a Zoom interview with the CTO;
Have a Zoom interview with the Middle Engineer from the team;
Have a Zoom interview with the CEO;
Get hired!
